import React from 'react';
import "./style.scss";

import firstimg from   "../../images/287b0fccb82e55024259135f704f9973.jpg";
import secondimg from  "../../images/a78e92e2d7e2d7495b4e9acc5221c66a.jpg";

export default function About() {
    return (
        <section className="about-section">
        <div className="about-row-layout">
            <img src = {firstimg} alt="image1"/>
        </div>
        <div className="about-column-layout">
            <img src = {secondimg} alt="image2"/>
        </div>
        </section>
    )
}
